namespace PatientMonitorDataLogger;

public static class SampleData
{
    public static ushort[] Pleth => DecodeUshort("");
    public static ushort[] Respiration => DecodeUshort("");
    public static ushort[] EcgII => DecodeUshort("");

    private static ushort[] DecodeUshort(
        string base64EncodedData)
    {
        var bytes = Convert.FromBase64String(base64EncodedData);
        var values = bytes.Chunk(2).Select(bytePair => BitConverter.ToUInt16(bytePair)).ToArray();
        return values;
    }
}